import React from "react";
import BorderColorRoundedIcon from "@material-ui/icons/BorderColorRounded";

function Header() {
  return (
    <header>
      <h1>
        <BorderColorRoundedIcon /> NoteKeeper
      </h1>
    </header>
  );
}

export default Header;
